<style>
*{box-sizing:border-box}
html,body{height:100%;margin:0;background:#000}

/* Lock body & let inner container scroll to avoid Safari bar resize flashes */
body{height:100dvh;overflow:hidden;touch-action:pan-y pan-x}
@supports not (height:100dvh){ body{height:100vh} }

.app{height:100%;overflow-y:auto;overflow-x:hidden;-webkit-overflow-scrolling:touch;
  overscroll-behavior-y:none; /* prevent rubber-band showing white root */}

/* Full-bleed background image below content */
.bg-fixed{
  position:fixed; inset:0; width:100vw; height:100dvh; z-index:0;
  object-fit:cover; object-position:center; pointer-events:none; user-select:none; background:#000;
}
@supports not (height:100dvh){ .bg-fixed{height:100vh} }

/* Content above background */
.page{position:relative; z-index:1; font-family:-apple-system,system-ui,Segoe UI,Roboto,Helvetica,Arial;color:#0a2a1a;
  -webkit-font-smoothing:antialiased; -moz-osx-font-smoothing:grayscale;}

.wrapper{min-height:100%;display:grid;place-items:center;
  padding:calc(1.2rem + env(safe-area-inset-top)) 1rem calc(1.2rem + env(safe-area-inset-bottom)) 1rem}
.panel{width:min(820px,92vw);background:rgba(255,255,255,.3);
  border-radius:24px;padding:1rem .75rem 1.5rem;
  box-shadow:0 10px 30px rgba(0,0,0,.25),inset 0 0 0 6px rgba(140,211,255,.85);
  border:8px solid rgba(95,184,234,.85)}
.heading{text-align:center;margin:.25rem auto 1rem;padding:.6rem 1rem;
  width:fit-content;background:#1f96dd;color:#fff;
  border-radius:16px;box-shadow:inset 0 -4px 0 rgba(0,0,0,.15);
  font-weight:700;font-size:clamp(1rem,2.4vw,1.25rem)}
.list{list-style:none;margin:0;padding:0 .5rem;display:grid;gap:.9rem;justify-items:center}
.tile{grid-template-columns:1fr;padding:.4rem;display:grid;width:100%}

/* Taller + narrower buttons */
.frame{width:min(560px,78%);height:120px;margin:0 auto;
  border-radius:16px;border:3px solid #0e2b66;
  overflow:hidden;background:#0a1220;box-shadow:0 3px 10px rgba(0,0,0,.28)}
.frame img{width:100%;height:100%;display:block;object-fit:fill}
.frame a{display:block;width:100%;height:100%}
.frame a img{width:100%;height:100%;object-fit:fill;display:block}

@media (orientation: landscape) {
  .panel{width:min(680px,70vw);padding:0.6rem 0.5rem 1rem;border-radius:18px}
  .heading{margin:.15rem auto .7rem;padding:.45rem .8rem;font-size:clamp(.8rem,1.9vw,1rem)}
  .list{gap:.6rem;padding:0 .35rem}
  .tile{padding:.3rem}
  .frame{width:min(520px,65%);height:100px;border-radius:14px;border-width:3px}
}
.footer{text-align:center;color:#e8f6ff;padding:1rem;text-shadow:0 1px 0 rgba(0,0,0,.4)}
</style>
